import React from "react";

const SlotM = (props) => {
    let x = props.x;
    let y = props.y;
    let z = props.z;
    
        if (x===y && y===z) {
            return (
                <>
                    <div className="slot_inner">
                        <h1> {x} {y} {z} </h1>
                        <h1> This is Maching </h1>
                        <hr />
                    </div>
                </>
            )
        }else {
            return (
                <>
                    <div className="slot_inner">
                        <h1> {x} {y} {z} </h1>
                        <h1> This is not Maching </h1>
                        <hr />
                    </div>
                </>
            )
        }
    }

    export default SlotM;
